import React from "react";
import MoonLoader from "react-spinners/MoonLoader";

const Loading = () => {
  return (
    <MoonLoader
      color="#282938"
      loading
      size={100}
      speedMultiplier={1}
      className="spinner"
    />
  );
};

export default Loading;
